import axios from "axios";
import Navbar from'./'


export const AddAction=({email: login,
    password: matkhau,})=>{
    const data= axios 
    .post("http://localhost:5000/users/login", {
        email: login ,
        password: matkhau

      })
      .then(res=>{<Navbar/>})


    return{
        type:SETLONGIN,
        payload:data

    }
}
